import { Component } from "react";
import '../css/home-emoji.css';
import EmojiList from '../component/emoji-list.js';

class SearchSymbols extends Component{
    render(){
        return(
            <div className="emoji-search-block">
                   <p> Are you looking for Emoji symbols? 
                    If yes, then you are on the right website because we have collected all Emoji symbols in one place and offering them for you to use on PC. 
                    All of them are supported on iOS, Android, OS X, Windows systems. </p>
                   
            </div>
        )
    }
}

export default SearchSymbols;
